import "./home.css"
import{Link} from 'react-router-dom'
import { useHistory } from "react-router-dom/cjs/react-router-dom.min"


function Card({item}) {
    let history =useHistory()
  const detail=()=>{
    history.push(`./detail-tour/${item.id}`)
  }
  sessionStorage.setItem('idCountry', JSON.stringify(item.idCountry));
    return ( 
        <div id="group" key={item.id}>
        < img id="gbr" onClick={detail} src ={require(`../../server/uploads/${item.image}`).default} className="image" alt = "" /><br/>
        <h2 onClick={detail} >{item.tittle}</h2>
        
        <section>
        <p>{item.price}</p><label>{item.country}</label>
        </section>
      
        </div>
    )
}
export default Card
